# -*- coding: utf-8 -*-

'''
Maximum Product of Word Lengths
===============================

Given a string array words, find the maximum value of
length(word[i]) * length(word[j]) where the two words do not share common
letters. You may assume that each word will contain only lower case letters.
If no such two words exist, return 0.

Example 1:

    Given ["abcw", "baz", "foo", "bar", "xtfn", "abcdef"]

    Return 16;

    The two words can be "abcw", "xtfn".

Example 2:

    Given ["a", "ab", "abc", "d", "cd", "bcd", "abcd"]
    Return 4

    The two words can be "ab", "cd".

Example 3:

    Given ["a", "aa", "aaa", "aaaa"]

    Return 0

    No such pair of words.

Follow up:
Could you do better than O(n2), where n is the number of words?
'''


class Solution(object):
    '''算法思路：

    每两个相比较

    Time: O(n^2)

    结果：TLE
    '''
    def getBits(self, word):
        record = getattr(self, 'record', {})
        if not record:
            setattr(self, 'record', record)

        if word not in record:
            record[word] = reduce(
                lambda x, y: x | y, (1 << ord(c) for c in word), 0)

        return record[word]

    def maxProduct(self, words):
        length, maximum, record = len(words), 0, {}
        for i in xrange(length - 1):
            for j in xrange(i + 1, length):
                if not self.getBits(words[i]) & self.getBits(words[j]):
                    maximum = max(maximum, len(words[i]) * len(words[j]))

        return maximum


class Solution(object):
    '''算法思路：

    同上，优化两点：

    - 不用每次调用 ord，而是预先生成映射
    - 预先生成长度，而不用每次调用

    Time: O(n^2)

    结果：TLE
    '''
    def maxProduct(self, words):
        maps = {chr(i): i - 97 for i in xrange(97, 123)}

        record = {
            w: [reduce(lambda x, y: x|y, (1 << maps[c] for c in w), 0), len(w)]
            for w in words
        }

        length, maximum = len(words), 0
        for i in xrange(length - 1):
            for j in xrange(i + 1, length):
                bitsA, bitsB = record[words[i]], record[words[j]]
                if not bitsA[0] & bitsB[0]:
                    maximum = max(maximum, bitsA[1] * bitsB[1])

        return maximum


class Solution(object):
    '''算法思路：

    同上，不过把哈希表改成了数组

    Time: O(n^2)
    结果：AC

    结论，看来还是数组比字典要快
    '''
    def maxProduct(self, words):
        maps = {chr(i): i - 97 for i in xrange(97, 123)}
        record = [
            [reduce(lambda x, y: x | y, (1 << maps[c] for c in w), 0), len(w)]
            for w in words]

        length, maximum = len(words), 0
        for i in xrange(length - 1):
            for j in xrange(i + 1, length):
                bitsA, bitsB = record[i], record[j]
                if not bitsA[0] & bitsB[0]:
                    maximum = max(maximum, bitsA[1] * bitsB[1])
        return maximum


class Solution(object):
    '''算法思路：

    同上，剪枝，把 words 按照长度由长到短排序，然后当 lenA * lenB < maximum 就
    break

    Time: 最坏 O(n^2)
    结果：AC
    '''
    def maxProduct(self, words):
        words.sort(cmp=lambda x, y: [1, -1][len(x) > len(y)])

        maps = {chr(i): i - 97 for i in xrange(97, 123)}
        record = [
            [reduce(lambda x, y: x | y, (1 << maps[c] for c in w), 0), len(w)]
            for w in words]

        length, maximum = len(words), 0
        for i in xrange(length - 1):
            bitsA, lenA = record[i]
            for j in xrange(i + 1, length):
                bitsB, lenB = record[j]

                if lenA * lenB < maximum:
                    break

                if not bitsA & bitsB:
                    maximum = max(maximum, lenA * lenB)

        return maximum


